body:
@chevdor Looking at the commit message I can see what this pull request is about now. Two things:
1. We are in the process of bumping the Node version to the latest LTS release (v8).
1. I have run `npm test` with both Node v6.11.5 and v8.9.0, and they both run fine, so it isn't clear to me the value in setting a specific Node version in a `.nvmrc`

@bestbeforetoday , I used cherry pick to transfer all commits from your branch to mine. Then I tried to commit and push all the changes. Even if I am using git commit -s -m , I still find DCO signoff check failing.
If I open my commit (most recent one from Commits tab), I can see the signoff statement as below:
Signed-off-by: shacshar <shacshar@in.ibm.com>

Fix for hyperledger/composer#1500.
Update of previous pull request #88.

@shacshar You could have just pushed an updated change to the branch from which you made pull request #88 to address review comments. No need to close and open an new pull request.
